---
struct: 'NewgroundsSong<''src>'
map_like: true
separator: '~|~'
indices:
  - value: 1
    type: u64
    maps_to: song_id
  - value: 2
    type: '&''src str'
    maps_to: name
    attributes:
      - borrow
  - value: 3
    type: u64
    maps_to: index_3
  - value: 4
    type: '&''src str'
    maps_to: artist
  - value: 5
    type: f64
    maps_to: filesize
  - value: 6
    type: 'Option<&''src str>'
    maps_to: index_6
  - value: 7
    type: 'Option<&''src str>'
    maps_to: index_7
  - value: 8
    type: '&''src str'
    maps_to: index_8
  - value: 10
    type: 'PercentDecoded<''src>'
    thunk: true
    maps_to: link
